import { client } from './client';

export type Maintenance = {
  id: string;
  monthlyFee: number;
  description: string;
};

export const getMaintenances = async (): Promise<Maintenance[]> => {
  const response = await client.get<Maintenance[]>('/maintenances');
  return response.data;
};
